import React from 'react';
// import logo from './logo.svg';
// import './App.css';
import NavbarSection from '../home/NavbarSection';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import HomeBackgroundImage from '../../assets/img/home-background.png'
import '../../assets/css/home.css'
import BackgroundImage from "react-background-image";
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles(theme => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
  backgroundImage: {
    width: '100%',
    position: 'absolute',
    backgroundBlendMode: 'luminosity',
    backgroundSize: 'cover',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
  },
  descriptionBackground: {
    flex: 1,
    justifyContent: 'flex-end',
    marginBottom: 0
  }
}));

export default function Home() {
  const classes = useStyles();

  return (
    <div>
      <Container fixed>
        <img src={HomeBackgroundImage} className={classes.backgroundImage} alt='website background' />
        <NavbarSection />
        <Typography className={classes.descriptionBackground} variant="h5" gutterBottom>
          h5. Heading </Typography>
      </Container>
    </div>
  )
}
